import arrow from "../../assets/arrow.png"

export default function SwellPeriod({ a }) {

    return (
        <Content>
            <>
            {a.map((value, index) => (
                    <Arrow
                        key={index}
                    />
                ))}
            </>
            <>
                {a.map((value, index) => (
                    <Period
                        key={index}
                        period={value.swellPeriod}
                    />
                ))}
            </>
        </Content>
    )
}
function Arrow() {
    return (
        <><img src={arrow} />
        </>
    )
}
function Period({ period }) {
    return (
        <>{period}</>
    )

}
const Content = styled.div`
border: 2px solid red;
width: 100%;
